// Time limit 66/73    2788ms of debug1 test case
const subarraysDivByK2 = (A, K) => {
    let n = A.length;
    let sum = 0;
    let cnt = 0;
    let round = 0;
    let map = new Map();
    let leftSumStart;
    for (let i = 0; i < n; i++) {
        if (round == 0) {
            sum += A[i];
            map.set(i, sum);
            if (sum % K == 0) {
                cnt++;
            }
        }
        // console.log(round, map.get(i));
        if ((map.get(i) - leftSumStart) % K == 0) {
            cnt++;
        }
        if (i == n - 1) {
            i = round;
            leftSumStart = map.get(i);
            round++;
        }
        if (round == n) break;
        // console.log(map);
    }
    return cnt;
};


